                  </div>
                  <div className="col-8">
                    <p>3 days</p>
                  </div>
                </div>
                <div className="row">
                  <div className="col-4">
                    <h3>
                      <b>Appeal:</b>
                    </h3>
                  </div>
                  <div className="col-8">
                    <p>7 days</p>
                  </div>
                </div>
              </div>
            </div>

            <div
              id="invoiceStopPaymentContent"
              style={{ display: "none" }}
            >
              <p style={{ color: "pink" }}>
                Pay the Gas fee in your wallet to stop the payment
                release.
              </p>
              <p>
                It may be better to first try and settle the dispute
                will the seller before stopping payment release.
              </p>
            </div>

            <div
              id="ViewAddNotePaid"
              className="InvoiceAddNote InvoiceAddNotepaid"
              style={{ display: "none" }}
            >
              <div className="row resolutionSelectedRow">
                <div className="col-9">
                  <div className="row">
                    <div className="col-3">
                      <img src={invoiceAddNote} alt="invoiceAddNote" />
                    </div>
                    <div className="col-9">
                      <p className="resolutionSelectedTxt">
                        Add Note
                        <br />
                        <span
                          style={{
                            fontSize: "14px",
                            fontWeight: "normal",
                          }}
                        >
                          provide feedback to Seller
                        </span>
                      </p>
                    </div>
                  </div>
                </div>
