                  className="col-3"
                  onClick={() => {
                    this.setState({ invoicePaidBtn: true });
                    document.getElementById(
                      "resolutionSelectedPaid"
                    ).style.display = "none";
                    document.getElementById(
                      "ViewAddNotePaid"
                    ).style.display = "none";
                    document.getElementById(
                      "contractSelectedPaid"
                    ).style.display = "none";
                  }}
                >
                  <img
                    src={invoiceAddNoteCross}
                    alt="invoiceAddNoteCross"
                  />
                </div>
              </div>
              <div className="ResolutionSelectedBodyTxt">
                <h3>
                  <b>18/02/20222</b>
                </h3>
                <textarea
                  className="viewAddNoteTexterea viewAddNoteTextereaPaid"
                  name=""
                  id=""
                ></textarea>
              </div>
            </div>

            <div
              id="contractSelectedPaid"
              className="contractSelected"
              style={{ display: "none" }}
            >
              <div className="row resolutionSelectedRow">
                <div className="col-9">
                  <div className="row">
                    <div className="col-3">
                      <img
                        src={invoiceContractDocuments}
                        alt="invoiceContractDocuments"
                      />
                    </div>
                    <div className="col-9">
                      <p className="resolutionSelectedTxt">
                        Contract <br /> Documents
                      </p>
                    </div>
                  </div>
                </div>
                <div
                  className="col-3"
                  onClick={() => {
                    this.setState({ invoicePaidBtn: true });
                    document.getElementById(
                      "resolutionSelectedPaid"
                    ).style.display = "none";
                    document.getElementById(
                      "ViewAddNotePaid"
                    ).style.display = "none";
                    document.getElementById(
                      "contractSelectedPaid"
                    ).style.display = "none";
                  }}
                >
                  <img
                    src={invoiceAddNoteCross}
                    alt="invoiceAddNoteCross"
                  />
                </div>
              </div>
              <div className="ResolutionSelectedBodyTxt">
                <div className="row">
                  <div className="col-6">
                    <div className="row">
                      <div className="col-3">
                        <img
                          src={invoiceContractDocumentsTerms}
                          alt="invoiceContractDocumentsTerms"
                        />
                      </div>
                      <div className="col-9 invoiceTermsTxt">
                        Terms & <br />
                        Conditions
                      </div>
                    </div>
                  </div>
                  <div className="col-6">
                    <div className="row">
                      <div className="col-3">
                        <img
                          src={invoiceContractDocumentsOther}
                          alt="invoiceContractDocumentsOther"
                        />
                      </div>
                      <div className="col-9 invoiceTermsTxt">
                        Product
                        <br />
                        Conditions
                      </div>
                    </div>
                  </div>
                </div>
                <div className="row" style={{ marginTop: "20px" }}>
                  <div className="col-6">
                    <div className="row">
                      <div className="col-3">
                        <img
                          src={invoiceContractDocumentsTerms}
                          alt="invoiceContractDocumentsTerms"
                        />
